const milisec_to_date = (date, format) => {
  switch (format) {
    case "yyyy-mm-dd":
      let arrayDate = date.split("-");
      arrayDate[2] = parseInt(arrayDate[2]) + 1;

      let endDay = new Date(arrayDate.join("-")).getTime();
      let startDay = new Date(date).getTime();
      let now = new Date.now();

      if (endDay < now) {
        let rate = "khoa học đã hoàn thành";
        return rate;
      } else {
        let rate = `${parseInt((now - startDay) / (endDay - startDay))}%`;
        return rate;
      }

    default:
      break;
  }
};

export default milisec_to_date;
